import React from 'react'
var tf = require('@tensorflow/tfjs')

let model = null
model = tf.loadLayersModel('https://drive.google.com/open?id=1XJk68dpwsFKnOU5rCUkr9AYKxjZFlzGK')

const Main = () => {

	if (model == null) 
		console.log('model loaded')
	return null
}

export default Main;
